import { contactUsConstants } from "../constants";

const initialState = {
  contactUsForm:{},
};

export function contactUs(state = initialState, action) {
  switch (action.type) {
    case contactUsConstants.CONTACT_US_FORM_REQUEST:
      return { ...state};
    case contactUsConstants.CONTACT_US_FORM_SUCCESS:
      return { ...state, contactUsForm: action.contactUsObj};
    case contactUsConstants.CONTACT_US_FORM_FAILURE:
      return { ...state, errors: action.errors};
    default:
      return { ...state };
  }
}
